    false,nt"url": null,nt"notes": "This narrative report for Snake Creek National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1962. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, collections and receipts, and vegetation control.
    Resource management is outlined; topics include grazing. A progress report on field
    investigations and applied research is also provided. The public relations section
    of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, and violations. Items of interest and N-R forms are attached.",nt"owner_org":
